// Dashboard.js
import React from 'react';

const Dashboard = () => {
  return (
    <div className="dashboard-container">
      <h2>Employee Productivity Dashboard</h2>
      <div className="productivity-data">
        <p>Monday: 80%</p>
        <p>Tuesday: 75%</p>
        <p>Wednesday: 85%</p>
        <p>Thursday: 90%</p>
        <p>Friday: 85%</p>
        <p>Saturday: 70%</p>
        <p>Sunday: 60%</p>
      </div>
    </div>
  );
}

export default Dashboard;
